import React, { useState } from "react";

export default function Todo() {
  const [name, setname] = useState("");

  const inputChangeHandler = (e) => {
    setname(e.target.value);
  };
  return (
    <div>
      <form action="">
        <input type="text" onChange={inputChangeHandler} />
        <p>{name}</p>
      </form>
    </div>
  );
}
